import Nav from 'react-bootstrap/Nav';
import { Outlet, Link } from 'react-router-dom';


const Dashboard = () => {
    return (
        <>
        <Navbar/>
        <Outlet/>
        </>
    )
}

export default Dashboard;



function Navbar() {
  return (
    <>
      <Nav className="justify-content-center" activeKey="/home">
        <Nav.Item>
          <Link to="/home"><Nav.Link >Home</Nav.Link></Link>
        </Nav.Item>
        <Nav.Item>
        <Link to="/home/registration"><Nav.Link >Register</Nav.Link></Link>
        </Nav.Item>
        <Nav.Item>
        <Link to="/course/running"><Nav.Link >Running Courses</Nav.Link></Link>
        </Nav.Item>
      </Nav>
    </>
  );
}
